import React from 'react'

function Map() {
  return (
    <div>
        <div class="mapouter"><div class="gmap_canvas"><iframe width="550" height="500" id="gmap_canvas" src="https://maps.google.com/maps?q=573%20W%20Vista%20Way,%20Vista,%20CA%2092083&t=&z=15&ie=UTF8&iwloc=&output=embed" frameborder="0" scrolling="no" marginheight="0" marginwidth="0"></iframe></div></div>
    </div>
  )
}

export default Map
